import React from 'react';

function Footer() {
  return (
    <div class="socials">
    <div class="social"><a href="https://vk.com/" target="_blank">
      <img src="https://cdn-icons-png.flaticon.com/512/25/25684.png"></img></a></div>
    <div class="social"><a href="https://vk.com/" target="_blank">
      <img src="https://cdn-icons-png.flaticon.com/512/12868/12868208.png"></img></a></div>
    <div class="social"><a href="https://vk.com/" target="_blank">
      <img src="pics\twitter.png"></img></a></div>
    <div class="social"><a href="https://vk.com/" target="_blank">
      <img src="pics\youtube.png"></img></a></div>
    </div>
    );
}
export default Footer;
